export default function attachDvpToMarkets(players) {
  return players.map(player => {
    const { dvp, markets } = player;
    if (!dvp || !markets) return player;

    // Helper para truncar a un decimal (sin redondear)
    const truncate = num => Math.floor(num * 10) / 10;

    const updatedMarkets = {
      ...markets,
      points: { ...markets.points, dvpValue: dvp.PTS },
      assists: { ...markets.assists, dvpValue: dvp.AST },
      rebounds: { ...markets.rebounds, dvpValue: dvp.REB },
      pointsAssists: { 
        ...markets.pointsAssists, 
        dvpValue: truncate(dvp.PTS + dvp.AST) 
      },
      pointsRebounds: { 
        ...markets.pointsRebounds, 
        dvpValue: truncate(dvp.PTS + dvp.REB) 
      },
      assistsRebounds: { 
        ...markets.assistsRebounds, 
        dvpValue: truncate(dvp.AST + dvp.REB) 
      },
      pointsAssistsRebounds: { 
        ...markets.pointsAssistsRebounds, 
        dvpValue: truncate(dvp.PTS + dvp.AST + dvp.REB) 
      }
    };

    return {
      ...player,
      markets: updatedMarkets
    };
  });
}
  const attach = attachDvpToMarkets(enrichPlayersData)
  await fs.writeFile(`08-attach.json`, JSON.stringify(attach, null, 2)   );

